import { Elements, EUI, Nodes, t, Translations } from '../constants'
import { ToggleSettingsItem } from '../components/settingsItem'
import styles from './styles.min.css'

export default function LiquidGlass() {
  if (!navigator.userAgentData) return  // return on non-chromium (e.g. safari & firefox)

  if ([1, 2, 4].includes(+localStorage.getItem(EUI.CustomTheme))) return

  const uiSettings = Nodes.SettingSections.at(1)
  if (!uiSettings) return

  if (localStorage.getItem(EUI.LiquidGlass) != 0) localStorage.setItem(EUI.LiquidGlass, 1)

  /* LG */
  const filterMap = `
<svg style="display: none">
    <filter id="displacementFilter">
        <feImage
          href="data:image/png;base64,"
          preserveAspectRatio="none"
        />
        <feDisplacementMap
          in="SourceGraphic"
          in2="turbulence"
          scale="600"
          xChannelSelector="R"
          yChannelSelector="G"
        />
    </filter>
    <filter id="displacementFilter2" primitiveUnits="objectBoundingBox">
        <feImage 
          result="map" 
          width="100%" 
          height="100%" 
          x="0" y="0" 
          href="data:image/webp;base64,"
        />
        <feGaussianBlur 
          in="SourceGraphic" 
          stdDeviation="0.04" 
          result="blur" 
        />
        <feDisplacementMap 
          id="disp" 
          in="blur" 
          in2="map" 
          scale="0.5" 
          xChannelSelector="R" 
          yChannelSelector="G" 
        />
    </filter>
    <filter id="displacementFilter3" primitiveUnits="objectBoundingBox">
        <feImage
          result="map" 
          width="100%" 
          height="100%" 
          x="0" y="0" 
          href="data:image/webp;base64,"
        />
        <feGaussianBlur
          in="SourceGraphic"
          stdDeviation="0.01"
          result="blur"
        />
        <feDisplacementMap
          id="disp"
          in="blur"
          in2="map"
          scale="0.5"
          xChannelSelector="R"
          yChannelSelector="G"
        />
    </filter>
</svg>
`

  // STYLES
  const filterContainer = document.createElement(Elements.Div)
  filterContainer.innerHTML = filterMap
  const style = document.createElement(Elements.Style)
  style.dataset.id = EUI.LiquidGlass
  style.innerHTML = styles

  const Enable = () => {
    document.head.appendChild(style)
    document.body.appendChild(filterContainer)
    localStorage.setItem(EUI.LiquidGlass, 1)
  }

  const Disable = () => {
    style.remove()
    filterContainer.remove()
    localStorage.setItem(EUI.LiquidGlass, 0)
  }

  const toggle = ToggleSettingsItem(t(Translations.liquidGlass), Enable, Disable, EUI.LiquidGlass, { subTitle: t(Translations.liquidGlassDesc) })
  uiSettings.appendChild(toggle)

  /* ELEMENTS */
  let elements = [
    Nodes.InventoryPopupClose, 
    Nodes.SettingsPopupClose,
    Nodes.Attack,
    Nodes.Ops,
    // Nodes.InfoPopupClose,
    Nodes.GetSelector('.leaderboard.popup button.popup-close'),
    Nodes.GetSelector('.profile.popup button.popup-close'),
    Nodes.GetSelector('.notifs.popup button.popup-close'),
    Nodes.GetSelector('.ol-control'),
    Nodes.GetSelector('.sbgcui_toolbar-control'),
  ]
  // let drawSliderButtons = Nodes.GetSelectorAll('.draw-slider-buttons button')
  // elements = elements.concat(drawSliderButtons)
  elements.forEach(element => {
    element && element.classList.add(EUI.LiquidGlass)
  })
}